import React from 'react';
import { useParams } from 'react-router-dom';
import CodeEditor from './CodeEditor';

const Room = () => {
  const { roomId } = useParams();

  return (
    <div>
      <h2 style={{ padding: '10px' }}>Room ID: {roomId}</h2>
      <CodeEditor roomId={roomId} />
    </div>
  );
};

export default Room;
